import React from 'react';
import { Box, Grid } from '@material-ui/core';
import './Css/Contact.scss'

const ContactForm = () => {
    return (
        <>
            <section>
                <Box className="contactSec">
                    <Grid container>
                        <Grid item lg={6} md={8} xs={10}>

                        </Grid>
                    </Grid>
                </Box>
            </section>
        </>
    )
}

export default ContactForm
